import { Layout, Menu, Switch } from 'antd';
import { MailOutlined, AppstoreOutlined } from '@ant-design/icons';
import './App.css';
import 'antd/dist/antd.css';

import {
  isIOS,
  isChrome,
  isFirefox,
  isSafari,
  isOpera,
  isIE,
  isEdge,
  isMobileSafari,
  browserVersion,
  browserName,
  mobileVendor,
  mobileModel,
  engineVersion,
  engineName,
  OsTypes,
  deviceDetect
} from "react-device-detect";

const { Header, Footer, Content } = Layout;
const { SubMenu } = Menu;

// Table..
const columns = [
  {
    title: 'Name',
    dataIndex: 'name',
    key: 'name',
    render: text => <a>{text}</a>,
    width: 150,
  },
  {
    title: 'Age',
    dataIndex: 'age',
    key: 'age',
    width: 80,
  },
  {
    title: 'Address',
    dataIndex: 'address',
    key: 'address 1',
    ellipsis: true,
  },
  {
    title: 'Long Column Long Column Long Column',
    dataIndex: 'address',
    key: 'address 2',
    ellipsis: true,
  },
  {
    title: 'Long Column Long Column',
    dataIndex: 'address',
    key: 'address 3',
    ellipsis: true,
  },
  {
    title: 'Long Column',
    dataIndex: 'address',
    key: 'address 4',
    ellipsis: true,
  },
];

const data = [
  {
    key: '1',
    name: 'John Brown',
    age: 32,
    address: 'New York No. 1 Lake Park, New York No. 1 Lake Park',
    tags: ['nice', 'developer'],
  },
  {
    key: '2',
    name: 'Jim Green',
    age: 42,
    address: 'London No. 2 Lake Park, London No. 2 Lake Park',
    tags: ['loser'],
  },
  {
    key: '3',
    name: 'Joe Black',
    age: 32,
    address: 'Sidney No. 1 Lake Park, Sidney No. 1 Lake Park',
    tags: ['cool', 'teacher'],
  },
];

// Table

function App() {
  if (isChrome) {
    return <div> This content is unavailable on mobile</div>
  }
  else {
    return <div> ...content </div>
  } return (
    <div>
      <Layout>
        <Header>
          <Menu mode="horizontal" theme="dark">
            <Menu.Item key="" icon={<MailOutlined />} title="Home">Home</Menu.Item>
            <SubMenu key="sub1" title="Career" >
              <Menu.Item key="2">Front-End Development</Menu.Item>
              <Menu.Item key="3">Back-End Development</Menu.Item>
              <Menu.Item key="4">Go</Menu.Item>
              <Menu.Item key="5">Others</Menu.Item>
            </SubMenu>
            <SubMenu key="sub2" icon={<AppstoreOutlined />} title="Themes">
              <Menu.Item key="5">PSD Templates</Menu.Item>
              <Menu.Item key="6">Wordpress Theme</Menu.Item>
              <SubMenu key="sub3" title="JavaScript">
                <Menu.Item key="7">React</Menu.Item>
                <Menu.Item key="8"> Angular </Menu.Item>
              </SubMenu>
            </SubMenu>
            <Menu.Item key="2">About Us</Menu.Item>
          </Menu>
        </Header>

        <Content>

          <p id="lol"></p>
        </Content>
        <Footer>Footer</Footer>
      </Layout>
    </div>
  );
}

export default App;
